import './App.css';
import { Routes, Route } from 'react-router-dom';
import Header from './Header Component/Component-Header';
import Navbar from './Navbar Component/Component-Navbar';
import Footer from './Footer Component/Component-Footer';
import Landing from './Pages/landing';
import Products from './Pages/products';
import Checkout from './Pages/checkout';
import Login from './Pages/login';
import Admin from './Pages/admin';
import register from './Pages/register';
import Register from './Pages/register';
import { useState } from 'react';

function App() {

  const [Brand, setBrand] = useState();
  const [Name, setName] = useState();
  const [Size, setSize] = useState();
  const [Price, setPrice] = useState();
  const [Description, setDescription] = useState();

  const getBrand = (e) => {
    let value = e.target.value;
    setBrand(value);
  }

  const getName = (e) => {
    let value = e.target.value;
    setName(value);
  }

  const getSize = (e) => {
    let value = e.target.value;
    setSize(value);
  }

  const getPrice = (e) => {
    let value = e.target.value;
    setPrice(value);
  }

  const getDecription = (e) => {
    let value = e.target.value;
    setDescription(value);
  }

  return (
    <div className="App">

      <div className='header'>
        <Navbar/>

        <Routes>
          <Route path='/Pages/landing' element={<Landing />} />
          <Route path='/Pages/products' element={<Products />} />
          <Route path='/Pages/checkout' element={<Checkout />} />
          <Route path='/Pages/login' element={<Login />} />
          <Route path='/Pages/admin' element={<Admin />} />
        </Routes>



      </div>
      <br></br>
      <div className='carousel'>
        <Header/>


      </div>
      <div className='page'>
        <br></br>
        <Landing/>
      </div>
      <div className='foot'>
        <Footer/>
      </div>


    </div>
  );
}

export default App;
